import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Gamepad = createReactComponent("Gamepad", ["svg", defaultAttributes, [["line", {
  x1: "6",
  y1: "12",
  x2: "10",
  y2: "12",
  key: "p15dmv"
}], ["line", {
  x1: "8",
  y1: "10",
  x2: "8",
  y2: "14",
  key: "12n05p"
}], ["line", {
  x1: "15",
  y1: "13",
  x2: "15.01",
  y2: "13",
  key: "ar4m67"
}], ["line", {
  x1: "18",
  y1: "11",
  x2: "18.01",
  y2: "11",
  key: "18afha"
}], ["rect", {
  x: "2",
  y: "6",
  width: "20",
  height: "12",
  rx: "2",
  key: "ubz4ml"
}]]]);
export default Gamepad;
